AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA=\",\"mime\":\"audio/mpeg\",\"copyright\":{\"license\":\"U\"}}],\"playAudio\":\"Play audio\",\"pauseAudio\":\"Pause audio\",\"audioNotSupported\":\"Your browser does not support this audio\"},\"library\":\"H5P.Audio 1.4\",\"subContentId\":\"5c908a09-b449-4080-93a6-11dcae8a9593\",\"metadata\":{\"license\":\"U\",\"contentType\":\"Audio\",\"title\":\"Untitled Audio\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Audio\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Les premiers jours en France</strong></p>\\n\\n<p>J’ai onze ans et je crois que demain sera le jour le plus important de ma vie. Demain ma vie d’Alexandrie va se terminer et celle de Paris va commencer. Nous quittons l’Egypte, nous partons pour toujours comme l’ont fait d’autres avant nous pour Montréal, New York, Milan… « Une vie qui finit, une autre qui démarre, » dit mon père, le visage rieur avec des yeux tristes. Cette nuit, je répète à voix basse : « Je pars pour toujours, je pars pour toujours. » C’est comme une chanson triste et gaie à la fois qui ressemblerait au visage de mon père.</p>\\n\\n<p><em>[Rebecca et ses parents arrivent à Paris et s’installent chez la tante Véra.]</em><br />\\n<br />\\nC'est Noël. Ce soir tante Véra m'a promis un morceau de bûche. Je l'imagine remplie de bonnes choses, mais à ma surprise, ce n'est qu'un petit morceau. Je prétends être satisfaite de ce petit morceau de glace comme mes parents font en prétendant que tout va bien dans cette nouvelle vie. Demain sera un grand jour pour moi, c'est le premier jour d'école en France. Durant cette semaine, j'ai vu certains monuments de Paris et l'art des grands peintres. Ce qui n'a rien à voir avec l'histoire de l'Égypte et des pharaons. Papa et maman m’accompagnent au lycée. À la récréation, tous les enfants m'interrogent avec des questions insensées. Au cours de gym, j'en profite pour montrer ce que je vaux car je suis bonne en gym, mais voilà que le climat froid auquel je ne suis pas habituée va m'empêcher d'atteindre le but que je me suis fixé.</p>\\n\\n<p style=\\\"text-align:right\\\">Eglal Errera, <em>Les Premiers Jours</em>.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"5f68274c-48c4-4719-a63a-ed68597130e3\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"introPage\":{\"showIntroPage\":false,\"startButtonText\":\"Start Quiz\",\"introduction\":\"\"},\"progressType\":\"dots\",\"passPercentage\":50,\"questions\":[{\"params\":{\"answers\":[{\"correct\":true,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Rebecca vient d'Egypte.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Rebecca a toujours vécu à Paris.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>On ne sait pas d'où vient Rebecca.</div>\\n\"}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"UI\":{\"checkAnswerButton\":\"Vérifie\",\"showSolutionButton\":\"Réponse\",\"tryAgainButton\":\"Réessaye\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"You got :num out of :total points\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":\"Should have been checked\",\"shouldNotCheck\":\"Should not have been checked\",\"noInput\":\"Please a
